    public int MaxProfit(int[] prices) {
        return MaxProfit_dp(prices);
    }

    // dynamic programming
    private int MaxProfit_dp(int[] prices) {
        int n = prices.Length;

        // dp[i, 0] -> the first time doesn't hold stock
        // dp[i, 1] -> the first time holds stock
        // dp[i, 2] -> the second time doesn't hold stock
        // dp[i, 3] -> the second time holds stock
        // dp[i, 4] -> after two times, not holding stocks.
        int[,] dp = new int[n, 5];

        // initialize 
        dp[0, 0] = 0;
        dp[0, 1] = -prices[0];
        dp[0, 2] = int.MinValue + 1000000;
        dp[0, 3] = int.MinValue + 1000000;
        dp[0, 4] = int.MinValue + 1000000;

        for (int i = 1; i < n; i++) {
            dp[i, 0] = dp[i - 1, 0];

            // day i holds stock for the first time, either from:
            // 1) day i-1 holds stock for the first time.
            // 2) day i-1 doesn't hold stock, and on day i buys stock for the first time.
            dp[i, 1] = Math.Max(dp[i - 1, 1], dp[i - 1, 0] - prices[i]);

            // day i doesn't hold stock: either day i-1 doesn't hold stock, or day i-1 holds stock and sold on day i.
            dp[i, 2] = Math.Max(dp[i - 1, 1] + prices[i], dp[i - 1, 2]);

            // day i holds stock for the second time, either:
            // 1) day i-1 holds stock for the second time or
            // 2) day i-1 doesn't hold stock for the second time, and on day i buys stock for the second time.
            dp[i, 3] = Math.Max(dp[i - 1, 3], dp[i - 1, 2] - prices[i]);

            // day i sold stocks twice, either from:
            // 1) day i-1 sold stocks twice, or
            // 2) day i-1 still holds stock for the second time, and sells on day i
            dp[i, 4] = Math.Max(dp[i - 1, 4], dp[i - 1, 3] + prices[i]);
        }

        var lst = (new List<int>() {dp[n - 1, 0], dp[n - 1, 1], dp[n - 1, 2], dp[n - 1, 3], dp[n - 1, 4]});
        return lst.Max();
    }

    // Use a state machine. (Doesn't work)
    public int MaxProfit_StateMachine(int[] prices) {
        var machine = new Machine(prices);
        while (machine.IsFinished == false) {
            machine.Run();
        }
        return machine.ReadProfit(2);
    }

    public enum State {
        Initial,
        ReadLeft,
        ReadRight,
        CreateWindow,
        End
    }

    private class Machine {
        public bool IsFinished => state == State.End;
        private int[] prices;
        private State state;
        private List<int> windows;
        private int index;
        private int? left = null;
        private int? right = null;
        public Machine(int[] _prices) {
            prices = _prices;
            state = State.Initial;
            windows = new();
            left = null;
            right = null;
        }

        public void Run() {
            switch (state) {
                case State.Initial:
                    DoInitial();
                    break;
                case State.ReadLeft:
                    ReadLeft();
                    break;
                case State.ReadRight:
                    ReadRight();
                    break;
                case State.CreateWindow:
                    CreateWindow();
                    break;
                case State.End:
                    DoEnd();
                    break;
                default:
                    break;
            }
        }

        public int ReadProfit(int num) {
            var orderlist = windows.OrderDescending();
            int nElem = Math.Min(num, orderlist.Count());
            return orderlist.Take(nElem).Sum();
        }

        private void DoInitial() {
            state = State.ReadLeft;
        }

        private void DoEnd() {
            windows.Sort();
        }

        private void ReadRight() {
            if (index >= prices.Length) {
                state = State.CreateWindow;
                return;
            }

            // read
            if (right is null || right < prices[index]) {
                right = prices[index++];
            } else {
                state = State.CreateWindow;
            }
        }

        private void CreateWindow() {
            if (left is not null && right is not null) {
                windows.Add(right.Value - left.Value);
            }
            left = null;
            right = null;
            state = State.ReadLeft;
        }

        private void ReadLeft() {
            if (index >= prices.Length) {
                state = State.End;
                return;
            }

            // read 
            if (left is null || prices[index] <= left) {
                left = prices[index++];
                return;
            } else {
                state = State.ReadRight;
            }
        }
    }
